description:
The UK's first ever street dance movie.

StreetDance 3D  follows the story of Carly and her dance crew Breaking Point as they work their way towards the UK Street Dance Championships featuring appearances from groups like Diversity, Flawless and Peridot, and backed by a supporting cast of UK street dancers including Lil Steph and Brooke Milliner.

